import { createStore } from 'redux';
import { CounterRedux } from '../counterRedux';


const Store = createStore(CounterRedux,   window.__REDUX_DEVTOOLS_EXTENSION__ && window.__REDUX_DEVTOOLS_EXTENSION__());
Store.subscribe(()=>{
    console.log("test state redux")
})
export default Store
